# =========================
# 3- main function
# =========================
# Python original:
#   def calculate_fidelity(self):
#       ...
#       self.results["fidelity"] = Coef*(F1 + F2 + F3 + F4)
#       return self.results["fidelity"]
#
# Julia convention:
#   - use ! because we mutate m.results
#   - return the computed value too
function calculate_fidelity!(m::Model)
    # Python: Cn1 = SPDC.moment_vector([1], 1)
    Cn1 = moment_vector([1], 1)
    Cn2 = moment_vector([1], 2)
    Cn3 = moment_vector([1], 3)
    Cn4 = moment_vector([1], 4)

    # Matrix values hardcoded for testing purposes. We will remove them when dependencies are ported.

    # calculate_loss_matrix_fid!(m)
    # calculate_k_function_matrix!(m)
    k_mat = k_function_matrix # m.results["k_function_matrix"]
    loss_mat = loss_bsm_matrix# m.results["loss_bsm_matrix"]
    # Gam      =  m.results["Gamma"]

    nA1 = k_mat + loss_mat

    # ---- Compute W terms ----
    F1 = W(Cn1, nA1, m.basisv)
    F2 = W(Cn2, nA1, m.basisv)
    F3 = W(Cn3, nA1, m.basisv)
    F4 = W(Cn4, nA1, m.basisv)

    # ---- Parameters ----

    detection_efficiency = m.params["detection_efficiency"]
    outcoupling_efficiency = m.params["outcoupling_efficiency"]
    N1 = ((detection_efficiency^2) * (outcoupling_efficiency^2))^2

    # ---- Determinant normalizations ----
    # Python:
    #   D1 = sqrt(det(nA1))
    #   D2 = (det(Gam))**(0.25)
    #   D3 = (det(conjugate(Gam)))**(0.25)
    #
    # Julia:
    #   conj.(A) is elementwise conjugation for arrays.
    #
    # 
    #   If on of the determinants is complex, sqrt and ^(0.25) use the principal complex root.
    #   That matches NumPy broadly, but can change phase if det moves around.
    D1 = sqrt(det(nA1))
    D2 = det(Gam)^(0.25)
    D3 = det(conj.(Gam))^(0.25)

    coef = N1 / (2 * D1 * D2 * D3)

    fid = coef * (F1 + F2 + F3 + F4)
    m.results["fidelity"] = fid
    return fid
end

